window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"21.0.1","implementation":{"name":"cucumber-jvm","version":"7.11.1"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"20+36-2344"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"},"ci":{"name":"Jenkins","url":"http://localhost:8080/job/Team2_SeleniumHackathon_Apr2024/11/","buildNumber":"11","git":{"remote":"https://github.com/nishaparanjape/Team2_SeleniumHackathon_Apr2024.git","revision":"1812ff558cbf126d469b6931ede1c42faae4c90f"}}}},{"testRunStarted":{"timestamp":{"seconds":1714534812,"nanos":365071400}}},{"source":{"uri":"file:///C:/Numpy_Ninja_2024/Team2_Selenium_Apr2024/src/test/resources/features/01login.feature","data":"@HomePage\n\nFeature: Login page Validation\n\tBackground:\n\tGiven Admin launch the browser\t\r\n\tWhen Admin gives the correct LMS portal URL\t\n\t\n\t@login1\n\tScenario: Verify admin is able to land on home page with invalid URL\n\tWhen Admin gives the invalid LMS portal URL\n\tThen Admin should receive 404 page not found error\n\n\t@login2\n\tScenario: Verify for broken link\t\t\n\tThen HTTP response >= 400 the link is broken\n\t\n\t@login666 @F\n\tScenario: Verify admin is able to land on home page\n\tThen Admin should land on the home page\n\t\n\t@login @1\n  Scenario: Verify the text spelling in the page \t\t\n  Then Admin should see correct spellings in all fields \n  \n  @login @1\n\tScenario: Verify the company logo\t\t\n\tThen Admin should see logo on the left side\n\n#\t@login\n#\tScenario: Verify application name\t\t\n#\tThen Admin should see LMS - Learning Management System\n#\t\n#\t@login666\t\n#\tScenario: Verify company name\t\t\n#\tThen Admin should see company name below the app name\n\t\n\t@login @1\n\tScenario: Validate sign in content\t\t\n\tThen Admin should see \"Please login to LMS application\"\n\t\n\t@login @1\n\tScenario: Verify text field is present\t\t\n\tThen Admin should see two text field\n\t\n\t@login @1\n\tScenario: Verify text on the first text field\t\t\n\tThen Admin should see \"user\" in the first text field\n\t\n\t@login @1\n\tScenario: Verify asterik next to user text\t\t\n\tThen Admin should see * symbol next to user text\n\t\n\t@login @1\n\tScenario: Verify text on the second text field\t\t\n\tThen Admin should see \"password\" in the second text field\n\t\n\t@login @1\n\tScenario: Verify asterik next to password text\t\t\n\tThen Admin should see * symbol next to password text\n\t\n\t@1\n\tScenario: Verify the alignment input field for the login\t\t\n\tThen Admin should see input field on the centre of the page\n\t\n\t@1\n\tScenario: verify Login is present\t\t\n\tThen Admin should see login button \n\t\n\t@1\n\tScenario: Verify the alignment of the login button\t\t\n\tThen Admin should see login button on the centre of the page\n\t\n\t@1\n\tScenario: Verify input descriptive test in user field\t\t\n\tThen Admin should see user in gray color\n\t\n\t@1\n\tScenario: Verify input descriptive test in password field\t\t\n\tThen Admin should see password in gray color\n\t\n\t@1\n\tScenario: Validate login with valid credentials\t\n\tWhen Admin is in Home Page\t\n\tWhen Admin enter valid credentials and clicks login button\n\tThen Admin should land on dashboard page\n\t\n\t @1\n\tScenario: Validate login with invalid credentials\t\t\n\tWhen Admin is in Home Page\t\n\tAnd Admin enter invalid credentials and clicks login button \t\n\tThen Error message please check username/password\n\t\n\t @F\n\tScenario: Validate login credentials with null username\t\n\tWhen Admin is in Home Page\t\n\tAnd Admin enter value only in password and clicks login button \t\n\tThen Error message please check username/password\n\t\n\t @F\n\tScenario: Validate login credentials with null password\t\n\tWhen Admin is in Home Page\t\n\tAnd Admin enter value only in username and clicks login button \t\n\tThen Error message please check username/password\n\t\n\t @F\n\tScenario: verify login button action through keyboard\t\n\tWh o: Validate data table headers in the User Page\n    \n    Then Admin Should see the data table with column names Id, Name, location, Phone Number, Edit/Delete\n    \n    @Userpagevalidation5\n  Scenario: Validating the default state of Delete button\n    \n    Then Admin should see a Delete button on the top left hand side as Disabled\n    \n    @Userpagevalidation6\n  Scenario: Validate \"+ A New user\" button in User Page\n   \n    Then Admin should be able to see the A New User button above the data table\n    \n    @Userpagevalidation7\n  Scenario: Validate \"+ Assign staff\"  button in User page\n   \n    Then Admin should be able to see the  Assign staff button above the data table\n    \nScenario: Validate + Assign Student  button in User page\nThen Admin should be able to see the \"+ Assign Student\" button above the data table-dd\n\nScenario: Validate search box in User page\nThen Admin should be able to see the search text box above the data table-dd\n\n#Addtional scenario\nScenario: Validate header count and column count in each row on the data table\nThen Admin should see similar count of header and coloumn on the data table-dd\n\nScenario: Verify Check box on the data table\nThen Each row in the data table should have a checkbox-dd\n\nScenario: Verify edit icon on the data table\nThen Each row in the data table should have a edit icon that is enabled-dd\n\nScenario: Verify  delete icon on the data table\nThen Each row in the data table should have a delete icon that is enabled-dd\n\nScenario Outline: Admin is on dashboard page after Login and clicks User on the navigation bar and search user by name-d\nGiven Admin is on Manage User Page-dd\nWhen Admin enters user name into search box-dd\nThen Admin should see user displayed with the entered \"<name>\" and \"<Scenario>\"-dd\nExamples: \n|name| Scenario|\n|Lms| valid name|\n|@1Alexander| invalid name|\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Numpy_Ninja_2024/
